import logo from "./logo.svg";
import "./App.css";
import "./Flex.css";
import HorizonLine from "./Horizontalline";

function App() {
  return (
    <div className="container">
      <div className="side"></div>
      <div className="center">
        <h1>기본 정보</h1>
        <HorizonLine />
      </div>
      <div className="side"></div>
    </div>
  );
}

export default App;
